import React from "react";
import "../../css/login.css";
function Login() {
  return (
    <>
      <div className="main-box">
        <div className="form-box">
          <h4 className="heading">Log in to your account</h4>

          <form>
            <label className="email-lable">Email address</label>
            <br />
            <input className="email-input" type="text" placeholder="enter email address" />
            <br />
            <label className="password-lable">Password</label>
            <br />
            <input className="password-input" type="password" placeholder="enter password" />
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
